INSERT INTO `catalog_pages` VALUES ('301', '-1', 'Wired', '10', '80', '1', '1', '1', '0', '0', '3', 'pets2', 'catalog_wired_header1', 'ctlg_pic_teaser_wired', '', 'Os Mobis Wired dar-lhe possibilidades quase infinitas!!!\r\n', '', 'Cmo funcionan?', 'Para obter uma completa Mobis Wired precisa de tres tipos.\r\n\r\n1. Ativadores: Coisas que voc precisa fazer para ter um efeito em seu lugar.\r\n2. Efeitos: O que acontece quando voc ativou uma causa.\r\n3. Condioes (opcional): Condioes que devem ocorrer antes que a causa e lanado.\r\n\r\nCon todo: Causante+Efecto+Condicin=Wired', '0', '', '', '');
