INSERT INTO `catalog_pages` VALUES ('304', '301', 'Condies', '1', '83', '1', '1', '1', '0', '0', '3', 'default_3x3', 'catalog_wired_header4_es', 'ctlg_pic_wired_conditions', '', 'Las Condiciones son determinados criterios que deben ser especificados antes de que el Causante se ponga en marcha. Si quieres usar una Condicin, debers apilarla sobre un Causante y un Efecto.', '', 'Haz clic en cada objeto para ver cmo funcionan las Condiciones!', '', '0', '', '', '');
